    function getCasesTaxonomy(terms) {
        let termArr = [];
        for (let i = 0; i < terms.length; i++) {
            termArr[i] = {
                id: terms[i].id,
                description: terms[i].description,
                parent: terms[i].parent,
                name: terms[i].name,
                slug: terms[i].slug,
            }
        }
        return termArr
    }

    function populateWithCases(args) {
        let arr = [];
        if (args.length < 6) {
            qty = args.length
        }
        for (let k = 0; k < qty; k++) {
            arr.push(populateCaseTemplate(args[k]))
        }
        if (!termsForCasePost) {
            casesQty(args);
            postsBlock.innerHTML = arr.join(' ')
        }
        if (args.length == 0) {
            errMsg = `<div class="err_msg_text" style="margin: 0 auto; max-width: 380px; height; 52px">
                        <p>Nothing is found.</p>
                        <p>Try changing your search criteria or reset filters.</p>
                      </div>
                      <div class="err_msg_btn">Reset filters</div>`;
            errMsgField.innerHTML = errMsg;
            errBtnClick()
        } else {
            errMsgField.innerHTML = ''
        }
    }

    function errBtnClick() {
        let button = document.querySelector('.err_msg_btn');
        button.addEventListener("click", function(event) {
            callback.call(filter[filtersID[740]]);
            const tagFilterAll = allFilters[0];
            errMsgField.innerHTML = '';
            filterCases(tagFilterAll)
        })
    }

