function handleInfoAfterCreatingDOM() {
    const countertest = document.querySelectorAll(".second-map-column");
    const hidmaps = document.querySelectorAll(".hid-map");
    const arrMaps = Array.from(hidmaps);
    const arrCoun = Array.from(countertest);
    arrCoun.forEach((elem, i) => {
        arrCoun[i].onclick = function() {
            arrCoun.forEach((elem, i) => {
                arrMaps[i].style.visibility = "hidden"
            });
            arrMaps[i].style.visibility = "visible"
        }
    });
    window.addEventListener('click', e => {
        const target = e.target
        if (!target.closest('.second-map-column')) {
            arrCoun.forEach((elem, i) => {
                arrMaps[i].style.visibility = "hidden"
            })
        }
    });
    const copyadress = document.querySelectorAll("#adress-copied");
    const wherecopy = document.querySelectorAll("#adress");
    const copyadressarr = Array.from(copyadress);
    const wherecopyarr = Array.from(wherecopy);
    arrCoun.forEach((elem, i) => {
        copyadressarr[i].onclick = function() {
            navigator.clipboard.writeText(wherecopyarr[i].innerText);
            setTimeout(function() {
                document.getElementById('headadv').click()
            }, 300)
        }
    })
}

function haversine(lat1, lon1, lat2, lon2) {
    const R = 6371;
    const dLat = toRadians(lat2 - lat1);
    const dLon = toRadians(lon2 - lon1);
    const a = Math.sin(dLat / 2) * Math.sin(dLat / 2) + Math.cos(toRadians(lat1)) * Math.cos(toRadians(lat2)) * Math.sin(dLon / 2) * Math.sin(dLon / 2);
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    const distance = R * c;
    return distance
}

function toRadians(degrees) {
    return degrees * Math.PI / 180
}

function sortCountries(countries, userLatitude, userLongitude) {
    return countries.sort((a, b) => {
        const distanceA = haversine(userLatitude, userLongitude, a.latitude, a.longitude);
        const distanceB = haversine(userLatitude, userLongitude, b.latitude, b.longitude);
        return distanceA - distanceB
    })
}

function sortByCountry(countriesArr) {
    const uniqueCountries = Array.from(new Set(countriesArr.map(office => office.address.country)));
    return countriesArr.sort((a, b) => {
        const indexA = uniqueCountries.indexOf(a.address.country);
        const indexB = uniqueCountries.indexOf(b.address.country);
        return indexA - indexB
    })
}

function countOffices() {
    let officesCount = 0;
    const OfficesIns = document.getElementById("counter-maps");
    for (const regionName in regions) {
        const regionCoordinates = regions[regionName].offices;
        for (const coordinate of regionCoordinates) {
            officesCount++
        }
    }
    OfficesIns.innerHTML = officesCount
}

function findNearestRegion(userLatitude, userLongitude, regions) {
    let nearestRegion = null;
    let minDistance = Number.MAX_VALUE;
    for (const regionName in regions) {
        const regionCoordinates = regions[regionName].offices;
        for (const coordinate of regionCoordinates) {
            const distance = haversine(userLatitude, userLongitude, coordinate.latitude, coordinate.longitude);
            if (distance < minDistance) {
                minDistance = distance;
                nearestRegion = regionName
            }
        }
    }
    return nearestRegion
}
const fetchUserData = async () => {
    try {
        await fetch('https://ipapi.co/json/').then(response => response.json()).then(userData => {
            const userLatitude = userData.latitude;
            const userLongitude = userData.longitude;
            const nearestRegion = findNearestRegion(userLatitude, userLongitude, regions).toLowerCase();
            const farthestRegions = createArrOfFarthestRegions(nearestRegion);
            const sortedOffices = sortByCountry(sortCountries(regions[nearestRegion].offices, userLatitude, userLongitude));
            createDOMStructure(regions[nearestRegion], sortedOffices);
            farthestRegions.forEach(region => {
                createDOMStructure(regions[region], regions[region].offices)
            })
        })
    } catch (error) {
        Object.keys(regions).forEach(region => {
            createDOMStructure(regions[region], regions[region].offices)
        })
    }
}
fetchUserData();

function createArrOfFarthestRegions(nearestRegion) {
    return Object.keys(regions).filter(region => region.toLowerCase() !== nearestRegion.toLowerCase())
}

function createDOMStructure(region, offices) {
    const officesContainer = document.querySelector(".Offices-container");
    const officesMap = document.createElement("div");
    officesMap.className = `Offices-map ${region.name.toLowerCase()}`;
    const firstColumnMap = document.createElement("div");
    firstColumnMap.className = "first-column-map";
    firstColumnMap.innerHTML = `
      <span>${region.name}</span>
      <div class="href-block">
        <a href="tel:${region.number.split(' ').join('')}">${region.number}</a>
      </div>
    `;
    const secondMapColumn = document.createElement("div");
    secondMapColumn.className = "grid-map-container";
    offices.forEach((office) => {
        const officeInfo = document.createElement("div");
        officeInfo.className = "second-map-column";
        officeInfo.innerHTML = `
        <div>
          <img decoding="async" src="${office.img}" alt="country-map" />
          <p>${office.address.country}</p>
        </div>
        <span id="adress"><b>${office.address.city}</b> ${office.address.street}</span>
        <div class="hid-map">
          <div id="adress-copied">
            <img data-lazyloaded="1" src="data:image/gif;base64,R0lGODdhAQABAPAAAMPDwwAAACwAAAAAAQABAAACAkQBADs=" decoding="async" data-src="/wp-content/uploads/2023/09/map/lucide_copy.svg"><noscript><img decoding="async" src="/wp-content/uploads/2023/09/map/lucide_copy.svg"></noscript>
            <span id="copy-adress">Copy address</span>
          </div>
          <div class="razd"></div>
          <div>
            <img data-lazyloaded="1" src="data:image/gif;base64,R0lGODdhAQABAPAAAMPDwwAAACwAAAAAAQABAAACAkQBADs=" decoding="async" data-src="/wp-content/uploads/2023/09/map/bi_pin-map.svg"><noscript><img decoding="async" src="/wp-content/uploads/2023/09/map/bi_pin-map.svg"></noscript>
            <a  target=_blank href=${office.hrefUrl} id="show-map">Show on map</a>
          </div>
        </div>
      `;
        secondMapColumn.appendChild(officeInfo)
    });
    officesMap.appendChild(firstColumnMap);
    officesMap.appendChild(secondMapColumn);
    officesContainer.appendChild(officesMap);
    countOffices();
    handleInfoAfterCreatingDOM()
};
