    let AudioContext = window.AudioContext || window.webkitAudioContext;
    let audioContext;
    let audioBlob;
    let drawVisual;
    let draw;
    let timerInterval;
    let countdownInterval;
    let isTimerPaused = !1;
    let isCountdownPaused = !1;
    let form;
    let sampleRate;
    let recordBtn = document.getElementById('qc_audio_record');
    const cForm = document.querySelectorAll('#qc_audio_recorder');
    if (recordBtn !== null) {
        recordBtn.addEventListener('click', (event) => {
            startRecordingButtonClick(event, cForm)
        })
    }
    jQuery(document).on('click', '#botbtnStop', function(e) {
        e.preventDefault();
        if (rec.recording) {
            rec.stop()
        }
        clearInterval(timerInterval);
        clearInterval(countdownInterval);
        window.cancelAnimationFrame(drawVisual);
        jQuery('.voice_countdown').hide();
        gumStream.getAudioTracks()[0].stop();
        rec.exportWAV((blob) => {
            createPayer(blob, cForm)
        })
    })

    function addvoicecontainer() {
        let html = '<div class="wpbot_voice_addon_container qc_audio_record_div" role="alert">' + '<div class="bot_voice_wrapper">' + '<div class="bot_recoding_animation">' + '<div class="bot-record-wrap">' + '<h2>' + voice_obj.qc_voice_widget_lan_speak_now + '</h2>' + '<div class="voice_countdown"></div>' + '</div>' + '<canvas width="150" height="30">' + '<div>' + voice_obj.qc_voice_widget_lan_canvas_not_available + '</div>' + '</canvas>' + '<p style="display:none">' + voice_obj.qc_voice_widget_lan_please_wait + '</p>' + '<button class="qc_audio_record_button" id="botbtnStop">' + voice_obj.qc_voice_widget_lan_stop_save + '</button>' + '</div>' + '<div class="wpbot_tts_wrapper"></div>' + '</div>' + '</div>';
        jQuery('#qc_audio_recorder').append(html)
    }

    function startRecordingButtonClick(event, cForm) {
        event.preventDefault();
        jQuery('#qc_audio_main').hide();
        jQuery('#voice-mut').hide();
        jQuery('.wpbot_voice_addon_container').remove();
        addvoicecontainer();
        jQuery('#qc_audio_recorder').show();
        var constraints_audio = {
            audio: {
                sampleRate: 32000,
                sampleSize: 400,
                channelCount: 1,
                volume: 1.0,
                echoCancellation: !1,
                autoGainControl: !1,
                noiseSuppression: !1,
                latency: 0
            },
            video: !1
        }
        navigator.mediaDevices.getUserMedia(constraints_audio).then(function(stream) {
            jQuery('.bot_voice_wrapper').removeAttr('style');
            jQuery('.bot_voice_wrapper').css("display", "flex");
            jQuery('.voice_countdown').html('');
            jQuery('.voice_countdown').show();
            audioContext = new AudioContext();
            sampleRate = audioContext.sampleRate;
            gumStream = stream;
            input = audioContext.createMediaStreamSource(stream);
            rec = new Recorder(input, {
                numChannels: 1
            });
            rec.record();
            createCountdown();
            createAnimation(cForm);
            createTimer(cForm)
        }).catch(function(err) {
            jQuery('.wpbot_voice_addon_container').remove();
            console.log('Error connecting with Mic. Please check your Mic.', 'warn', !0);
            console.log(err, 'error', !0);
            alert(' If your microphone is not working, please check your browser settings to ensure that it is enabled for audio recording.')
        })
    }

    function createCountdown() {
        const countdownElement = document.querySelector('.voice_countdown');
        clearInterval(countdownInterval);
        let maxDuration = voice_obj.capture_duration;
        let countdown = voice_obj.capture_duration;
        isCountdownPaused = !1;
        let resetMinutes = Math.floor(maxDuration / 60);
        let resetSeconds = maxDuration - resetMinutes * 60;
        countdownElement.innerHTML = resetMinutes + ':' + resetSeconds;
        countdownInterval = setInterval(function() {
            if (isCountdownPaused) {
                return
            }
            countdown--;
            if (maxDuration !== 0 && countdown < 0) {
                jQuery('#botbtnStop').trigger('click')
            }
            let minutes = Math.floor(countdown / 60);
            let seconds = countdown - minutes * 60;
            if (seconds < 10) {
                seconds = "0" + seconds
            }
            countdownElement.innerHTML = minutes + ':' + seconds
        }, 1000)
    }

    function createTimer(cForm) {
        let timer = 0;
        let maxDuration = voice_obj.capture_duration;
        clearInterval(timerInterval);
        isTimerPaused = !1;
        timerInterval = setInterval(function() {
            if (isTimerPaused) {
                return
            }
            timer++;
            if (maxDuration !== 0 && timer > maxDuration) {
                jQuery('#botbtnStop').trigger('click')
            }
        }, 1000)
    }

