function clickElem(x) {
    const remake = document.querySelector("span.wpcf7-form-control-wrap:nth-child(1) > div:nth-child(1) > div:nth-child(3) > div:nth-child(2)");
    const changer = document.querySelector("div.contact-us__wrapper:nth-child(3) > span:nth-child(2) > div:nth-child(1) > div:nth-child(2)");
    const changertwo = document.querySelector("div.contact-us__wrapper:nth-child(3) > span:nth-child(2) > div:nth-child(1) > div:nth-child(3) > div:nth-child(2) > span:nth-child(1)");
    const changerthree = document.querySelector("div.contact-us__wrapper:nth-child(3) > span:nth-child(2) > div:nth-child(1) > div:nth-child(3) > div:nth-child(2)");
    const changerfour = document.querySelector("#form-field-budget_js > option:nth-child(2)");
    let option = x.getAttribute("data-value");
    if (option === "IT staff augmentation") {
        changer.innerText = 'Project budget (min. $7K)*';
        changertwo.innerText = '$7K-$30K';
        changerfour.selectedIndex = '1';
        changerfour.innerText = '$7K-$30K'
    } else if (option === "Turnkey product development" || option === "Support and enhancement" || option === "Careers" || option === "Other") {
        changer.innerText = 'Project budget (min. $15K)*';
        changertwo.innerText = '$15K-$30K';
        changerfour.selectedIndex = '1';
        changerfour.innerText = '15K-$30K'
    }
    let targetElem = x.getElementsByTagName('*')[0].parentElement.parentElement.parentElement;
    let elemId = targetElem.children[0].getAttribute('id');
    document.cookie = `${elemId}=${option}; expires=${Date.now() + COOCKIE_LIFE_TIME}; path=/`
};;